import styled from 'styled-components'


const Main = styled.main`
width: 100vw;
height: 1500px;
`

const MainContainer = styled.div`
width: 90%;
max-width: 1100px;
margin-left: auto;
margin-right: auto;
`


export { Main, MainContainer }
